<h3>inexsuperabilis</h3>
<div><b>in-exsuperābilis, e</b></div>
<div>1) непереходимый, непроходимый (<em>montes L</em>)</div>
<div>2) не(пре)одолимый (<em>vis fati L</em>)</div>
<div>3) непревзойдённый, несравненный (<em>imperium, sc. Alexandri Ap</em>); высший (<em>bonum Sen</em>)</div>
